O le SANXINHERB ose fa'apolofesa gaosi oloa ma fa'atau oloa fa'amatagofie fa'alelei sili ona lelei na maua mai i mea fa'alenatura. I le avea ai ma tagata fa'atau oloa teuteu, matou te ofoina atu le tele o mea fa'aoga mo le tausiga o le pa'u, tausiga o lauulu, tausiga o le tagata lava ia, ma le fa'avasegaina o lanu. O la matou su'esu'ega o lo'o aofia ai mea fa'a-natura fa'alenatura fa'amaonia fa'apea fo'i mea fa'alenatura fa'alenatura ma gaioiga. O i matou o tagata gaosi mea fa'amatagofie mo nisi
..........
 ma faʻamautinoaga lelei e mafai ona e faʻatuatuaina. Matou te maua mea i le lalolagi atoa ma ua fa'amautu so'otaga fa'atasi ma le au fa'atau oloa fa'atau oloa teuteu mata'utia. E mafai ona avea i matou ma au mea fa'atau mea teuteu fa'alenatura sili ona lelei. E sili atu i le 12 tausaga o le poto masani faʻamautinoa e maua e tagata faʻatau uma se sapalai gafataulimaina ma mautu o oloa. E mafai ona matou tuʻuina atu ia te oe mea faʻapitoa faʻapitoa, e pei ole Blueberry Extract Proanthocyanidins;
